function setActive(){var t=document.getElementById("loginForm");t.classList.contains("login-active")||t.classList.add("login-active");var n=document.getElementById("signup");n.classList.contains("hidden")||n.classList.add("hidden")}function setInactive(){var t=document.getElementById("loginForm");t.classList.contains("login-active")&&t.classList.remove("login-active");var n=document.getElementById("signup");n.classList.contains("hidden")&&n.classList.remove("hidden")}